import React from "react";

function About() {
  return (
    <div>

      <p>
          As an automotive technician for an extensive amount of years. I've always had to go to my TOOL BOX 
          and pull out the correct tool to perform a specialized auto repair.
      </p>
      <p>
        THE TOOL BOX is a company knowledgebase to centralize information, streamline processes, and 
        homogenize communication across all business verticals. This is a complement to in-house training and
        mentorship for new associates and newly acquired organizations.
      </p>
    </div>
  );
}

export default About;
